import React from 'react';

const HelloSt = {
    backgroundColor : 'black'
    , color : 'aqua'
    , fontSize : 24
    , padding : '1rem'
    , textAlign : 'center'
}

function Hello(props){
    return(
        <>
            <div style={HelloSt}>안녕하세요!</div>
            <div>이 프로젝트의 이름은 {props.name}  입니다.</div>
            <div>색깔은 {props.color} 입니다.</div>
        </>

    );
}

export default Hello;
